script: |
  super -f text -I q10410.spq | sort > q10410.out

inputs:
  - name: q10410.spq
    data: |
      SELECT DISTINCT col2 + - + col0 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT 4 * - col0 * + col1 + + col0 BETWEEN - + 54 AND + + col1;
  - name: tab0

outputs:
  - name: q10410.out
    data: |
      -77
      2
      32
